import React, { useEffect } from 'react';
import '../assets/css/footerPaginaUnica.css';
import '../assets/css/reportPaginaUnica.css';
import '../assets/css/stylesPaginaUnica.css';
import '../assets/css/chat.css';

function Analise() {
  useEffect(() => {
    submitOnChange();
    // carregarMapa();
  }, []);

  const submitOnChange = () => {
    const form = document.getElementById('formularioAnalise');
    const formData = new FormData(form);
    const formObject = Object.fromEntries(formData.entries());

    fetch('/analisar', {
      method: 'POST',
      headers: { 'Content-Type': 'application/x-www-form-urlencoded' },
      body: new URLSearchParams(formObject),
    })
      .then((response) => response.json())
      .then((data) => {
        animateUpdate('vlrM2Venda', `Valor de M² de Venda: ${data.valorM2Venda}`);
        animateUpdate('vlrVendaNominal', `Valor de Venda Nominal: ${data.valorVendaNominal}`);
        animateUpdate('vlrM2Loc', `Valor de M² de Locação: ${data.valorM2Locacao}`);
        animateUpdate('vlrLocacaoNominal', `Valor de Locação Nominal: ${data.valorLocacaoNominal}`);
        animateUpdate('Rentabilidade', `Rentabilidade Média: ${data.rentabilidadeMedia}`);
      })
      .catch((error) => {
        console.error('Erro:', error);
        alert("Amostra insuficiente para análise");
      });
  };

  const carregarMapa = (tipoMapa = '', cluster = 5, tamanho_mapa = '') => {
    document.getElementById('nrCluster').value = cluster;
    document.getElementById('outCluster').value = cluster;

    fetch(`/carregar_mapa?tipo=${tipoMapa}&cluster=${cluster}&tamanho=${tamanho_mapa}`)
      .then((response) => response.text())
      .then((data) => {
        const map = document.getElementById('map');
        if (map) map.innerHTML = data;
      })
      .catch((error) => {
        console.error('Erro ao carregar o mapa:', error);
        alert("Erro ao carregar o mapa.");
      });
  };

  const animateUpdate = (id, text) => {
    const el = document.getElementById(id);
    if (!el) return;
    el.style.opacity = 0;
    setTimeout(() => {
      el.innerText = text;
      el.style.opacity = 1;
    }, 300);
  };

  const alterarCluster = (valor, botao) => {
    document.querySelectorAll("button").forEach(btn => btn.classList.remove("active-button"));
    botao.classList.add("active-button");
    document.getElementById('nrCluster').value = valor;
    document.getElementById('outCluster').value = valor;
    submitOnChange();
  };

  return (
    <main>
      <div className="main-container">
        <form id="formularioAnalise" method="post">
          <label>Tipo de Imóvel:</label>
          <select name="tipoImovel" defaultValue="Apartamento" onChange={submitOnChange}>
            <option value="Apartamento">Apartamento</option>
          </select>

          <label>Bairro:</label>
          <select name="bairro" defaultValue="ASA NORTE" onChange={submitOnChange}>
            <option value="ASA NORTE">ASA NORTE</option>
            <option value="ASA SUL">ASA SUL</option>
            <option value="NOROESTE">NOROESTE</option>
            <option value="SUDOESTE">SUDOESTE</option>
            <option value="AGUAS CLARAS">AGUAS CLARAS</option>
          </select>

          <label>Quartos:</label>
          <select name="quartos" defaultValue="0" onChange={submitOnChange}>
            <option value="0">Todos</option>
            <option value="1">1</option>
            <option value="2">2</option>
            <option value="3">3</option>
            <option value="4">4+</option>
          </select>

          <label>Vagas:</label>
          <select name="vagas" defaultValue="10" onChange={submitOnChange}>
            <option value="10">Todos</option>
            <option value="0">0</option>
            <option value="1">1+</option>
          </select>

          <div id="nome">
            <label>Metragem (m²):</label>
            <input
              type="number"
              name="metragem"
              defaultValue="0"
              onChange={submitOnChange}
              onKeyDown={(e) => {
                if (e.key === 'Enter') {
                  e.preventDefault();
                  submitOnChange();
                }
              }}
            />
            <button type="button" onClick={(e) => alterarCluster(2, e.target)}>ORIGINAL</button>
            <button type="button" onClick={(e) => alterarCluster(5, e.target)}>SEMI-REFORMADO</button>
            <button type="button" onClick={(e) => alterarCluster(8, e.target)}>REFORMADO</button>
          </div>

          <ul className="lista-com-imagem">
            <li id="vlrM2Venda" className="negrito"><strong>Valor de M² de Venda:</strong></li>
            <li id="vlrVendaNominal" className="negrito"><strong>Valor de Venda Nominal:</strong></li>
            <li id="vlrM2Loc" className="negrito"><strong>Valor de M² de Locação:</strong></li>
            <li id="vlrLocacaoNominal" className="negrito"><strong>Valor de Locação Nominal:</strong></li>
            <li id="Rentabilidade"><strong>Rentabilidade Média:</strong></li>
          </ul>

          <div className="container">
            <label className="TituloCluster">Número de Clusters (1 a 9):</label>
            <input
              type="range"
              name="nrCluster"
              id="nrCluster"
              min="1"
              max="9"
              defaultValue="5"
              onInput={(e) => {
                document.getElementById('outCluster').value = e.target.value;
                submitOnChange();
              }}
            />
            <output id="outCluster">5</output>
            <img src="/static/img/LOGO 61 PNG (3).png" alt="Imagem sobre o campo" className="imagem-sobreposta" />
          </div>
        </form>

        <div id="map" style={{ marginTop: '20px' }}></div>
      </div>
    </main>
  );
}

export default Analise;
